import React, { Fragment, useEffect, useState } from "react";
// import "./Products.css";
import { useSelector, useDispatch } from "react-redux";
// import { clearErrors, getProduct } from "../actions/productAction";
// import Loader from "../layout/Loader/Loader";
// import ProductCard from "../Home/ProductCard";
import Pagination from "react-js-pagination";
import PropTypes from "prop-types";
// material
import { Grid } from "@mui/material";
// import Slider from "@material-ui/core/Slider";
import Page from "../components/Page";
import { useAlert } from "react-alert";
import { Typography, Card, Link, Container } from "@mui/material";
import {
  ProductSort,
  ProductList,
  ProductCartWidget,
  ProductFilterSidebar,
} from "../components/_dashboard/products";
import ShopProductCard from "../components/_dashboard/products/ProductCard";
const categories = ["It", "Furniture", "Grocery", "Sports", "Socities"];
ProductList.propTypes = {
  products: PropTypes.array.isRequired,
};

const UserProducts = ({ product }) => {
  const dispatch = useDispatch();

  return (
    <Page title="Dashboard: User Products | Stokify">
      <Container>
        <Typography variant="h4" sx={{ mb: 5 }}>
          Inventory Available
        </Typography>

        <Link className="productCard" to={product._id}>
          <Grid container spacing={3}>

              <Grid key={product.id} item xs={12} sm={6} md={3}>
                <ShopProductCard product={product} />
              </Grid>
            ))}
          </Grid>
        </Link>
      </Container>
    </Page>
  );
};

export default UserProducts;
